2	Why us?	<p><span style="font-size:14px;"><strong><span style="color:#e67e22;">Why ByEzzy!&nbsp;</span></strong></span></p>\r\n\r\n<p>Your Selling Journey Made Easier&nbsp;</p>\r\n\r\n<p>We Empower Businesses, Regardless of Size, to Connect with Broader Customer Base.</p>\r\n\r\n<p>What more?</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<h4>Innovative, safe and easy to use Platform</h4>\r\n\r\n\t<p>A secure and transparent platform. We safeguard every transaction ensuring that sellers feel confident and relaxed.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>Your inventory, our commitment</h4>\r\n\r\n\t<p>With a well-managed surveillance systems and Warehouse Management System (WMS), track your inventory, we ensure product safety and security.</p>\r\n\r\n\t<p>We have a stringent safety policy in place to ensure that your products are always safe and secure. Our facility is monitored 24/7 by security cameras &amp; we have a team of trained security guards.</p>\r\n\r\n\t<p>We also have a fire suppression system in place to protect your products in the event of a fire.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>Timely Delivery</h4>\r\n\r\n\t<p>Same day delivery for the orders placed before 2PM. Next day delivery for rest of the orders.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>Your product, more eyes</h4>\r\n\r\n\t<p>Join us and become visible to thousands of customers with diverse backgrounds and needs.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>More revenue, less hassle</h4>\r\n\r\n\t<p>Our commission structure starts from less than 5% for the completed orders.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>24/7 Swift Seller Support</h4>\r\n\r\n\t<p>Our expert support team is always available to answer your questions, address your concerns and accompany you at every step.</p>\r\n\r\n\t<p>Contacting us is easy. We are available via various channels &ndash; phone, Email, chat, from 9 am to 9 pm. Our sellers &amp; customers can reach out to us during these hours and expect an immediate response from our dedicated team.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>Easy to Use Platform</h4>\r\n\r\n\t<p>No complicated process. Easy product listing steps and inventory management.</p>\r\n\t</li>\r\n\t<li>\r\n\t<h4>Payment Policy</h4>\r\n\r\n\t<p>Your payment will be processed every 7 to 21 days (about 4 and a half weeks).</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Partner With Us. Let&rsquo;s Grow Together</p>\r\n\r\n<p>We simplify the selling process by receiving inventory directly from the sellers. There on, we take care of all the packaging, making sure that each product is perfectly wrapped and stored. Moreover, we ensure that your products reach the right audience through targeted promotion and advertisements.</p>\r\n\r\n<p>How it Works?</p>\r\n\r\n<p>Sign up to Byezzy Seller portal, upload your company details, followed by the product details. Leave the rest to us!</p>\r\n\r\n<p>Mission</p>\r\n\r\n<p>To revolutionize seller experience in the UAE by providing unparalleled convenience of product storage, packing and super-fast delivery, ensuring the quality and affordability. Fostering an environment of trust and reliability, we aspire to become the go-to destination for every seller by simplifying the selling process.</p>\r\n\r\n<p>Vision</p>\r\n\r\n<p>We envision a world where every seller enjoys effortless access to our platform and wide range of services. Byezzy aims to stand as the beacon of trust, innovation, and reliability, setting new global standards in B2C ecommerce, starting with UAE and expanding globally.</p>\r\n	t	2024-09-09 05:51:18.633398	2024-09-09 10:22:39.969161	header
3	Features	<p><strong><span style="color:#e67e22;">Become a Part of Our Seller Community &ndash; Where Trust and Innovation Drive Success&nbsp;</span></strong></p>\r\n\r\n<p>Your one-stop destination for growing your business.</p>\r\n\r\n<p>Starting out? Or first time to an online market place or a seasoned seller?</p>\r\n\r\n<p>Our core features</p>\r\n\r\n<p>Partner Catalog</p>\r\n\r\n<p>Easy Product Listing: Single &amp; Bulk Upload</p>\r\n\r\n<p>Sell fast with our flexible listing options!</p>\r\n\r\n<p>With Fulfilled by Partner (FBP), you maintain complete control over fulfillment. Once an order is placed, you handle packaging, shipping, and delivery to the customer. This option is ideal for sellers who have their own fulfillment systems or prefer a more hands-on approach.</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Single Product Upload - Perfect for adding unique items or testing new products. Enter details one by one in the seller portal.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Bulk Upload - Save time listing large inventories. Download our template, fill it with product information, and upload it back for a quick and efficient listing process.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Product listing</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Create high-quality product listings - Your product listings are the first thing that potential buyers will see, so it&#39;s important to make sure that they&#39;re well-written and informative.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Use high-quality images - Images are a great way to showcase your products and make them more appealing to potential buyers</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Set competitive prices - Your prices should be competitive with other sellers on Byezzy.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Fulfilled By Byezzy</p>\r\n\r\n<p>Hassle-Free Fulfillment with Byezzy (FBB)</p>\r\n\r\n<p>Focus on sales, we&#39;ll handle the rest!</p>\r\n\r\n<p>Byezzy takes care of everything from storage to delivery. Simply send your products to our warehouse and we&#39;ll pack, ship, and deliver them directly to your customers. FBB keeps things easy and convenient for you.</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Order Status - Track your orders in real-time, always knowing exactly where things stand.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Stock Management &amp; Storage - We handle storage and keep your inventory organized, so you can focus on sales.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Fees &amp; Disputes - Transparent fee structure and clear processes for handling any disputes that may arise.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Damage &amp; Returns - We manage damage claims and returns, streamlining your fulfillment experience.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Warehouse Management</p>\r\n\r\n<p>Our warehouse management system includes a range of advanced tools to optimize every aspect of our warehouse management process. With automated systems and inventory management software in place, we reduce manual tasks and provide real-time visibility into tock levels and its mobility. Barcode and RFID technology further ensures accuracy and traceability throughout the supply chain. With integrated order processing systems and quality control measures, we not only manage incoming orders and stock them in specialized storage areas but also ensure product integrity and customer satisfaction. Furthermore, our WMS provides real-time analytics and reporting capabilities that help us monitor performance and make informed decisions.</p>\r\n\r\n<p>Fulfilled by Partner</p>\r\n\r\n<p>Fulfilled by Partner (FBP): You&#39;re in Control</p>\r\n\r\n<p>Prefer to pack and deliver yourself? No problem!</p>\r\n\r\n<p>With Fulfilled by Partner (FBP), you maintain complete control over fulfillment. Once an order is placed, you handle packaging, shipping, and delivery to the customer. This option is ideal for sellers who have their own fulfillment systems or prefer a more hands-on approach.</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Order Management - Accept or reject orders as you see fit.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Warehouse - Add and update warehouse details for efficient stock management.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>View stock logs to track inventory movement.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Manage delivery requests to ensure timely fulfillment.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Promotions &amp; Ads</p>\r\n\r\n<p>Boost Your Sales with Byezzy Promotions &amp; Ads</p>\r\n\r\n<p>Reach more customers and grow your business!</p>\r\n\r\n<p>Byezzy empowers sellers to create targeted promotions and ad campaigns directly through our platform.</p>\r\n\r\n<p>Run Deals &amp; Offers - Attract new customers and boost sales with exciting discounts, coupons, and flash sales.</p>\r\n\r\n<p>Sell smarter, not harder with Byezzy Promotions &amp; Ads!</p>\r\n\r\n<p>Build Your Brand Presence on Byezzy</p>\r\n\r\n<p>Create a seamless shopping experience for your customers</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Create Brands &amp; Stores - Establish a distinct brand identity and set up dedicated stores within the seller portal.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Brand Catalog - Organize your product portfolio under individual brands for a clear and targeted customer journey.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Multi-Brand Stores - Showcase a wider selection by creating stores that feature products from various brands, catering to diverse customer needs.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Customer Happiness Indicator</p>\r\n\r\n<p>Gain Trust &amp; Grow with Byezzy&#39;s Customer Happiness Indicators</p>\r\n\r\n<p>See what your customers are saying!</p>\r\n\r\n<p>Byezzy provides valuable customer insights through our comprehensive Customer Happiness Indicators:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Seller Rating - Track your overall performance and build trust with potential buyers.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Delivery Rating - Monitor the delivery efficiency and ensure a positive customer experience.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Catalog/Product Rating - Get feedback on your product quality and identify areas for improvement.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Analytics &amp; Reports</p>\r\n\r\n<p>Gain Valuable Insights with Byezzy Analytics &amp; Reports</p>\r\n\r\n<p>Make data-driven decisions for success!</p>\r\n\r\n<p>Byezzy equips you with powerful analytics and reporting tools to:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Track Key Metrics - Monitor sales performance, inventory levels, customer behavior, and more.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Gain Data-Driven Insights - Uncover valuable trends and optimize your business strategies based on real data.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Make Informed Decisions - Use insights to improve product offerings, marketing campaigns, and overall sales strategy.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>Support</p>\r\n\r\n<p>Dedicated Seller Support for a Smooth Experience</p>\r\n\r\n<p>Dedicated Seller Support for a Smooth Experience</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Multiple Support Channels - Reach our helpful support team through various channels, including email, phone, or live chat.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Dedicated Account Manager (For High-Volume Sellers) - High-volume sellers receive personalized support from a dedicated account manager for an even more streamlined experience.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Extensive Knowledge Base - Access a wealth of helpful resources in our comprehensive knowledge base, covering frequently asked questions, tutorials, and troubleshooting guides.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>We care about our sellers! Start selling with us!</p>\r\n	t	2024-09-09 10:23:10.706785	2024-09-09 10:23:10.706785	header
